Dutch:
Nicky (Will Smith) is een meester op het gebied van misleiding, die een relatie krijgt met de nieuwbakken oplichtster Jess (Margot Robbie). Terwijl hij haar de fijne kneepjes van het vak leert, ziet hij in haar een risico en verbreekt de relatie. Drie jaar later duikt zijn voormalige vlam, nu een volleerde femme fatale, op in Buenos Aires, tijdens een lucratieve autorace. Nicky speelt een levensgevaarlijk spel, maar Jess gooit al zijn plannen in de war waardoor de doortrapte oplichter volledig van de wijs raakt.
